create table personaggi
(
    id           int auto_increment
        primary key,
    nome         varchar(255) not null,
    cognome      varchar(255) not null,
    data_nascita date         not null,
    nazionalita  varchar(255) not null,
    biografia    text         not null,
    foto         mediumblob   null,
    data_morte   date         null,
    sesso        char         not null
);

INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (1, 'Leonardo', 'DiCaprio', '1974-11-11', 'USA', 'Leonardo Wilhelm DiCaprio è un attore, produttore cinematografico e attivista statunitense di origini italiane.

Acclamato dalla critica per il suo lavoro in una vasta gamma di generi cinematografici, nel corso della sua carriera ha collaborato con James Cameron, Baz Luhrmann, Danny Boyle, Clint Eastwood, Christopher Nolan, Steven Spielberg, Ridley Scott, Sam Mendes, Sam Raimi, Woody Allen, Alejandro González Iñárritu, Quentin Tarantino e soprattutto con Martin Scorsese, con cui ha stretto un sodalizio professionale sin dal 2002, considerandolo il suo mentore.

Iniziò la sua carriera apparendo in diversi spot televisivi nei primi anni novanta, per poi ricoprire piccoli ruoli in varie serie tv. Nel 1991 fece il suo debutto nel mondo del cinema con Critters 3, mentre nel 1994 ottenne la sua prima candidatura all\'Oscar per la sua interpretazione in Buon compleanno Mr. Grape. Nel 2016 vinse l\'Oscar come miglior attore per la sua interpretazione di Hugh Glass in Revenant - Redivivo di Iñárritu. Tra i vari riconoscimenti ottenuti figurano anche 6 candidature all\'Oscar, 3 Golden Globe su 12 candidature e un premio BAFTA su 4 candidature.

Nel 2014 fu nominato Messaggero della Pace dal segretario generale delle Nazioni Unite Ban Ki-moon, mentre nel 2016 fu inserito dalla rivista Time al primo posto tra le 100 persone più influenti del pianeta, nella categoria icona.', , null, 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (2, 'Kate', 'Winslet', '1975-10-05', 'Regno Unito', 'Kate Elizabeth Winslet (nata il 5 ottobre 1975) è un\'attrice inglese. Conosciuta per il suo lavoro in film indipendenti, in particolare drammi in costume, così come per i suoi ritratti di donne testarde e complicate, ha ricevuto numerosi riconoscimenti, tra cui un Academy Award, un Grammy Award, due Primetime Emmy Awards, tre British Academy Film Awards, e cinque Golden Globe.

Winslet ha studiato recitazione alla Redroofs Theatre School. La sua prima apparizione sullo schermo, all\'età di 15 anni, è stata nella serie televisiva britannica Dark Season (1991). Ha fatto il suo debutto cinematografico interpretando un\'adolescente assassina in Heavenly Creatures (1994), e ha vinto un BAFTA Award per aver interpretato Marianne Dashwood in Sense and Sensibility (1995). La celebrità globale è seguita subito dopo con il suo ruolo da protagonista nell\'epico romanzo Titanic (1997), che le è valso una nomination all\'Oscar come migliore attrice protagonista. Titanic è stato il film di maggior incasso all\'epoca, dopo di che ha evitato parti in film di successo a favore di film d\'epoca acclamati dalla critica, tra cui Quills (2000) e Iris (2001).

La storia d\'amore di fantascienza Eternal Sunshine of the Spotless Mind (2004), in cui Winslet è stata scelta contro il tipo in un ambiente contemporaneo, si è rivelata un punto di svolta nella sua carriera e ha ottenuto un ulteriore riconoscimento per le sue interpretazioni in Alla ricerca dell\'isola che non c\'è (2004) , Little Children (2006), Revolutionary Road (2008) e The Reader (2008). Per aver interpretato un\'ex guardia del campo nazista in quest\'ultimo, ha vinto il BAFTA Award e l\'Oscar come migliore attrice. L\'interpretazione di Winslet di Joanna Hoffman nel film biografico Steve Jobs (2015) le è valsa un altro BAFTA Award e ha vinto due Primetime Emmy Awards per le sue interpretazioni nella miniserie della HBO Mildred Pierce (2011) e Mare of Easttown (2021).

Per la sua narrazione di un racconto nell\'audiolibro Listen to the Storyteller (1999), Winslet ha vinto un Grammy Award. Ha eseguito la canzone "What If" per la colonna sonora del suo film Christmas Carol: The Movie (2001). Co-fondatrice dell\'ente di beneficenza Golden Hat Foundation, che mira a creare consapevolezza sull\'autismo, ha scritto un libro sull\'argomento, The Golden Hat: Talking Back to Autism (2010). La rivista Time l\'ha nominata una delle 100 persone più influenti al mondo nel 2009 e nel 2021. Nel 2012 è stata nominata Comandante dell\'Ordine dell\'Impero Britannico (CBE). Divorziata dai registi Jim Threapleton e Sam Mendes, Winslet è sposata con l\'uomo d\'affari Edward Abel Smith dal 2012. Ha un figlio da ogni matrimonio.', , null, 'F');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (3, 'Elijah', 'Wood', '1981-01-28', 'USA', 'Elijah Jordan Wood (nato il 28 gennaio 1981) è un attore e produttore americano. È meglio conosciuto per la sua interpretazione di Frodo Baggins nella trilogia del film Il Signore degli Anelli (2001-2003) e Lo Hobbit: Un viaggio inaspettato (2012).

Wood ha fatto il suo debutto cinematografico con una piccola parte in Ritorno al futuro, parte II (1989). Ha continuato a ottenere il riconoscimento come attore bambino con ruoli in Avalon (1990), Paradise (1991), Radio Flyer (1992), Forever Young (1992), Le avventure di Huck Finn (1993) e The Good Son (1993). ). Da adolescente, ha recitato in film come North (1994), The War (1994), Flipper (1996), The Ice Storm (1997), Deep Impact (1998) e The Faculty (1998). Dopo il successo de Il Signore degli Anelli, Wood è apparso in una vasta gamma di film, tra cui Spy Kids 3D: Game Over (2003), Eternal Sunshine of the Spotless Mind (2004), Sin City (2005), Green Street Hooligans (2005), Everything Is Illuminated (2005), Paris, je t\'aime (2006), Bobby (2006), Celeste and Jesse Forever (2012), Maniac (2012), Grand Piano, Cooties, The Last Witch Hunter (2015 ), La fiducia (2016),

I ruoli vocali di Wood includono Mumble in Happy Feet (2006) e il suo sequel (2011), il personaggio del titolo in 9 (2009), Spyro the Dragon nella trilogia di videogiochi Legend of Spyro (2006-2008), Beck in Tron di Disney XD: Uprising (2012-2013) e Wirt nella miniserie di Cartoon Network Over the Garden Wall (2014). Ha anche interpretato Ryan Newman nella serie comica dark di FX Wilfred (2011-2014), per la quale ha ricevuto una nomination al Satellite Award come miglior attore, e Todd Brotzman nella serie della BBC America Dirk Gently\'s Holistic Detective Agency (2016-2017).', , null, 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (4, 'Bryan', 'Cranston', '1956-03-07', 'USA', 'Bryan Lee Cranston è un attore, regista, produttore cinematografico e doppiatore americano.

Nasce il 7 Marzo 1956 a Los Angeles, suo padre era un attore e sua madre un\'interprete di radiodrammi. Entrambi di origini tedesche.

E\' sposato con l\'attrice Robin Dearden con la quale ha avuto una figlia.

Deve la sua fama al ruolo di Hal, il padre della sit com americana "Malcom" e di Walter White, protagonista della pluripremiata serie televisiva "Breaking Bad", interpretazione che gli è valsa quattro premi Emmy come miglior attore protagonista nel 2008, nel 2009 nel 2010 e nel 2014.

Ha anche avuto un ruolo minore nella sit com "How I met your mother" nel ruolo del capo di Ted Mosby.

E\' conosciuto anche per molte interpretazioni cinematografiche come "Total Recall - Atto di forza", "Argo", "Godzilla" e "L\'ultima parola - La vera storia di Dalton Trumbo".', , null, 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (5, 'Millie', 'Bobby Brown', '2004-02-19', 'Regno Unito', 'Millie è nata in spagna il 19 Febbario 2004 da genitori inglesi. La sua famiglia si è trasferita a Orlando, in Florida (USA) nel 2011, dove Millie, durante un workshop di recitazione frequentato per passare il tempo, è stata notata da una talent scout, che ha consigliato ai genitori di mettere a frutto ad Hollywood la sua bravura nel recitare.

La famiglia di Millie si è così spostata a Los Angeles, dove Millie ha incontrato diversi agenti, che si sono tutti offerti di rappresentarla. A tre mesi dal trasferimento, le è stato offerto il ruolo di Alice da giovane in "Once Upon a Time", seguito a novembre 2013 dall\'offerta del ruolo di Madison O\'Donnel in "Intruders", della BBC America. Nel 2015 viene scelta per il ruolo di Undici nella serie tv targata Netflix "Stranger Things", mentre nel 2019 fa il suo debutto al cinema come co-protagonista nel film "Godzilla II - King of the Monsters".

Nel 2018 incomincia a collaborare alla realizzazione di una serie di film incentrati su Enola Holmes, giovane detective e sorella minore del celebre Sherlock Holmes. Il primo film, "Enola Holmes", uscito nel 2020 in esclusiva sulla piattaforma Netflix con la regia di Harry Bradbeer.', , null, 'F');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (6, 'Jennifer', 'Aniston', '1969-02-11', 'USA', 'Jennifer Joanna Anastassakis, meglio nota come Jennifer Aniston (Los Angeles, 11 febbraio 1969), è un\'attrice, regista e produttrice cinematografica statunitense.

La Aniston ha ottenuto il riconoscimento in tutto il mondo per aver interpretato Rachel Green nella popolare sitcom televisiva Friends (1994-2004), un ruolo che le è valso un Premio Emmy, un Golden Globe e uno Screen Actors Guild Award. Il personaggio era molto popolare durante la messa in onda della serie, ed è stato riconosciuto come uno dei "100 più grandi personaggi femminili in televisione negli Stati Uniti".

I suoi successi al botteghino includono Una settimana da Dio (2003), Ti odio, ti lascio, ti... (2006), Io & Marley (2008), Mia moglie per finta (2011), Come ammazzare il capo e vivere felici (2011) e Come ti spaccio la famiglia (2013), ognuno dei quali hanno incassato oltre $200 milioni di entrate in tutto il mondo. Le sue interpretazioni più acclamate sono in The Good Girl (2002) e Cake (2014), per il quale ha ricevuto una candidatura per il Golden Globe per la migliore attrice in un film drammatico e agli Screen Actors Guild Awards. È cofondatrice, nel 2008, della società di produzione Echo Films.

Nel 2004, la Aniston è stata classificata "la donna più bella" dal periodico People, ed è stata eletta la "donna più sexy di tutti i tempi" nel 2011. Nel 2012, ha ricevuto una stella sulla Hollywood Walk of Fame, ed è una delle attrici più pagate di Hollywood. Nel 2007, è stata classificata come "11ª donna più ricca nel settore dello spettacolo", con una fortuna stimata di $110 milioni. È stata inserita da molte riviste negli elenchi di donne più belle del mondo.', , null, 'F');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (7, 'Tom', 'Hanks', '1956-07-09', 'USA', 'Thomas Jeffrey Hanks, detto Tom (Concord, 9 luglio 1956), è un attore, regista, sceneggiatore, doppiatore, produttore cinematografico e produttore televisivo statunitense.

La sua carriera ha avuto inizio negli anni ottanta quando, interpretando la serie Henry e Kip (Bosom Buddies), cominciò a esser conosciuto; da allora ha recitato in numerosi film ottenendo un grande successo di critica e di pubblico. Nel corso della sua carriera ha ricevuto cinque candidature agli Oscar, ed è tra i pochi attori nella storia ad aver vinto due Oscar al miglior attore consecutivamente: nel 1994 per Philadelphia e nel 1995 per Forrest Gump. Ha inoltre vinto quattro Golden Globe, due Screen Actors Guild Award, cinque Emmy e un Orso d\'argento al Festival di Berlino.

Tra gli incarichi svolti c\'è stato, a partire dal 2005, quello di vicepresidente dell\'Academy, la società che ogni anno assegna i premi Oscar. Hanks, inoltre, anche se non è più vicepresidente, è tuttora membro del Consiglio di Amministrazione dell\'Academy.', , null, 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (8, 'Robert', 'Zemeckis', '1951-05-14', 'USA', 'Robert Lee Zemeckis (nato il 14 maggio 1952) è un regista, produttore e sceneggiatore americano. Zemeckis è venuto all\'attenzione del pubblico per la prima volta negli anni \'80 come regista della serie di film comici Ritorno al futuro sul viaggio nel tempo, così come del film epico live-action / animazione vincitore di un Oscar Chi ha incastrato Roger Rabbit (1988), anche se nel Negli anni \'90 si è diversificato in piatti più drammatici, incluso Forrest Gump del 1994, per il quale ha vinto un Academy Award come miglior regista.', , null, 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (9, 'Winston', 'Groom', '1944-03-23', 'USA', 'Winston F. Groom, Jr. (nato il 23 marzo 1944) è un romanziere e scrittore di saggistica americano, meglio conosciuto per il suo libro Forrest Gump, che è stato adattato in un film nel 1994.', , '2020-09-17', 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (10, 'Robin', 'Wright', '1966-04-08', 'USA', 'Robin Gayle Wright (nato l\'8 aprile 1966) è un\'attrice americana. È meglio conosciuta per i suoi ruoli come Jenny Curran in Forrest Gump, come Buttercup in The Princess Bride e come Mary Surratt in The Conspirator. È stata anche accreditata come Robin Wright Penn.', , null, 'F');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (11, 'Eric', 'Roth', '1945-03-22', 'USA', 'Eric Roth (nato il 22 marzo 1945) è uno sceneggiatore americano. Ha vinto l\'Oscar per la migliore sceneggiatura adattata per Forrest Gump (1994). Ha anche co-scritto la sceneggiatura di The Insider (1999) di Michael Mann, il film di Steven Spielberg Munich (2005) e il film di David Fincher Il curioso caso di Benjamin Button (2008), tutti nominati agli Oscar.

Roth è nato a New York City, New York, figlio di Miriam "Mimi", insegnante, dirigente di studio e scrittrice radiofonica, e Leon Roth, insegnante universitario e produttore cinematografico. Ha conseguito un Master of Fine Arts (MFA) presso la UCLA Film School e una laurea presso l\'Università della California', , null, 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (12, 'Gary', 'Sinise', '1995-03-17', 'USA', 'Gary Alan Sinise (nato il 17 marzo 1955) è un attore, regista, umanitario e musicista americano. Tra gli altri premi, ha vinto un Primetime Emmy Award, un Golden Globe, un Tony Award e quattro Screen Actors Guild Awards. Ha anche ricevuto una stella sulla Hollywood Walk of Fame ed è stato nominato per un Academy Award.

Ha anche ricevuto numerosi premi e riconoscimenti per il suo vasto lavoro umanitario e il coinvolgimento con organizzazioni di beneficenza. È un sostenitore di varie organizzazioni di veterani e ha fondato la Lt. Dan Band (dal nome del suo personaggio in Forrest Gump), che suona nelle basi militari di tutto il mondo.

La sua carriera di attore è iniziata sul palcoscenico con la Steppenwolf Theatre Company nel 1983, quando ha diretto e interpretato una produzione di True West di Sam Shepard per la quale ha vinto un Obie Award. In seguito avrebbe ottenuto quattro nomination ai Tony Award, anche per le sue interpretazioni in L\'uva dell\'ira e Qualcuno volò sul nido del cuculo. Ha vinto il Regional Theatre Award del Tony Award insieme alla Steppenwolf Theatre Company.

Ha recitato per la prima volta nell\'adattamento cinematografico del romanzo classico di John Steinbeck Uomini e topi, che ha anche diretto e prodotto. Sinise ha interpretato George Milton al fianco di John Malkovich che interpretava Lennie.

Uno dei suoi ruoli più noti è quello del tenente Dan Taylor in Forrest Gump (1994) per il quale è stato nominato all\'Oscar come miglior attore non protagonista. È apparso anche in altri lungometraggi tra cui Apollo 13 (1995) di Ron Howard, Ransom (1996), Il miglio verde (1999) e Impostor (2002) di Frank Darabont.

Le sue interpretazioni televisive includono Harry S. Truman in Truman (1995), per il quale ha vinto un Golden Globe, e il ruolo principale nel film televisivo George Wallace, per il quale ha ricevuto un Primetime Emmy Award.

Ha avuto un ruolo da protagonista nel ruolo del detective Mac Taylor nella serie drammatica della CBS CSI: NY (2004-2013). Dal 2016 al 2017 ha recitato nel ruolo dell\'agente speciale Jack Garrett in Criminal Minds: Beyond Borders. Nel 2017, ha avuto un ruolo nella serie Netflix 13 Reasons Why.

È stato anche narratore di numerose docuserie e documentari.', , null, 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (13, 'Zachary', 'Levi', '1980-09-29', 'USA', 'È conosciuto soprattutto per i ruoli di Kipp Steadman nella serie televisiva Perfetti... ma non troppo e Chuck Bartowski nella serie televisiva Chuck. Dal suo nome completo ha fatto decadere il cognome di origine gallese Pugh (che si pronuncia Più), considerandolo difficile da collocare nel mondo dello spettacolo', , null, 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (14, 'Ian', 'McKellen', '1939-05-25', 'Regno Unito', 'Sir Ian Murray McKellen, CH, CBE (nato il 25 maggio 1939) è un attore inglese. Ha ricevuto sei Laurence Olivier Awards, un Tony Award, un Golden Globe Award, uno Screen Actors Guild Award, un BIF Award, due Saturn Awards, quattro Drama Desk Awards e due Critics\' Choice Awards. Ha anche ricevuto due candidature all\'Oscar, otto candidature cinematografiche e televisive ai BAFTA e cinque candidature agli Emmy. Il lavoro di McKellen abbraccia generi che vanno dal teatro shakespeariano e moderno al fantasy popolare e alla fantascienza. I suoi ruoli cinematografici degni di nota includono Gandalf nelle trilogie de Il Signore degli Anelli e Lo Hobbit e Magneto nei film degli X-Men.', , null, 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (15, 'Stan', 'Lee', '1922-12-28', 'USA', 'Stan Lee, pseudonimo di Stanley Martin Lieber (New York, 28 dicembre 1922 – Los Angeles, 12 novembre 2018[1]), è stato un fumettista, editore, produttore cinematografico e televisivo statunitense.

È noto per essere stato presidente e direttore editoriale (Editor in Chief) della casa editrice di fumetti Marvel Comics, per la quale ha sceneggiato numerose storie.

Conosciuto anche come The Man (L\'Uomo) e The Smilin (Il Sorridente), ha introdotto per la prima volta, insieme con diversi artisti e co-creatori, in special modo Jack Kirby e Steve Ditko, personaggi di natura complessa e con personalità sfaccettate all\'interno dei comic book supereroistici. Il suo successo permise alla Marvel di trasformarsi da piccola casa editrice in una grande azienda di stampo multimediale.', , '2018-11-12', 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (16, 'Stephen', 'McFeely', '1969-11-12', 'USA', 'Stephen McFeely is a writer and producer, known for Captain America: The Winter Soldier (2014), Captain America: The First Avenger (2011) and Thor: The Dark World (2013).', , null, 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (17, 'Joe', 'Russo', '1971-07-18', 'USA', 'Anthony e Joe Russo, conosciuti insieme professionalmente come i fratelli Russo, sono registi cinematografici e televisivi americani vincitori di un Emmy Award. I fratelli dirigono la maggior parte del loro lavoro insieme e occasionalmente lavorano anche come produttori, attori e montatori. I Russo sono di Cleveland, Ohio, e sono nati a un anno di distanza. Sono alunni della Case Western Reserve University.', , null, 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (18, 'Robert', 'Downey Jr.', '1965-04-04', 'USA', 'Robert John Downey Jr. è un attore e produttore cinematografico statunitense.

Debutta sul grande schermo, insieme a suo padre Robert Downey Sr., già all\'età di cinque anni. Nel 1993 viene candidato per la prima volta all\'Oscar al miglior attore e vince un Premio BAFTA per l\'interpretazione di Charlie Chaplin nel film Charlot. Nel 2000 si è unito al cast della serie TV Ally McBeal, grazie alla quale ha ricevuto un Golden Globe per il miglior attore non protagonista in una serie e lo Screen Actors Guild Award per il miglior attore in una serie commedia.

A partire dal 2008, Downey si è imposto all\'attenzione internazionale grazie al ruolo del supereroe Iron Man.

Nel 2009 ha recitato nel film di Guy Ritchie, Sherlock Holmes, vincendo il Golden Globe per il miglior attore in un film commedia o musicale, e nel 2011, nel sequel Sherlock Holmes - Gioco di ombre.', , null, 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (19, 'Chris', 'Evans', '1981-06-13', 'USA', 'Christopher Robert Evans, detto Chris, è un attore e regista statunitense, di origini irlandesi e italiane. È particolarmente noto grazie all\'interpretazione della Torcia Umana nei film sui Fantastici Quattro e di Capitan America nei film del Marvel Cinematic Universe.', , null, 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (20, 'Mark', 'Ruffalo', '1967-11-22', 'USA', 'Mark Ruffalo è un attore, regista, produttore cinematografico e sceneggiatore statunitense.

Inizia a recitare al cinema alla fine degli anni novanta, raggiungendo consensi da parte di pubblico e critica per svariate interpretazioni, come Zodiac di David Fincher e Shutter Island di Martin Scorsese. Nel 2012 prende il posto di Edward Norton nel ruolo di Bruce Banner/Hulk all\'interno del Marvel Cinematic Universe, interpretando il ruolo in The Avengers, ruolo che riprende in seguito in Avengers: Age of Ultron (2015), in Thor: Ragnarok (2017), in Avengers: Infinity War (2018) e in Avengers: Endgame (2019). Nel corso della sua carriera ha ricevuto tre nomination ai Premi Oscar nella categoria miglior attore non protagonista nel 2011 per I ragazzi stanno bene, nel 2015 per Foxcatcher - Una storia americana e nel 2016 per Il caso Spotlight.', , null, 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (21, 'Chris', 'Hemsworth', '1983-08-11', 'Australia', 'Chris Hemsworth è nato e cresciuto tra Melbourne e Bulman (piccolo centro abitato a 400 km a sud-est di Darwin), figlio di Craig, un amministratore dei servizi sociali, e Leonie, un\'insegnante di inglese, e secondo di tre figli. Ha due fratelli, Luke e Liam, entrambi attori e noti sul grande schermo. Con la famiglia si trasferisce durante l\'adolescenza a Phillip Island. Dopo gli studi alla Heathmont Secondary College di Melbourne, comincia a lavorare in produzio', , null, 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (22, 'Scarlett', 'Johansson', '1984-11-22', 'USA', 'Scarlett Ingrid Johansson è un\'attrice, modella, doppiatrice e cantante statunitense.

Attrice sex symbol, ha cominciato a farsi notare per i suoi ruoli nei film L\'uomo che sussurrava ai cavalli (1998), Ghost World (2001) e L\'uomo che non c\'era (2001). Ha ricevuto gli elogi della critica per la sua interpretazione nel film La ragazza con l\'orecchino di perla (2003) e Lost in Translation - L\'amore tradotto (2003), per il quale ha ricevuto anche due candidature ai Golden Globe e ha vinto il BAFTA alla migliore attrice protagonista per l\'ultimo film citato. Ha ricevuto altre due candidature ai Golden Globe per Una canzone per Bobby Long (2004) e Match Point (2005). Nel 2011 ha vinto un Tony Award per il suo ruolo nello spettacolo Uno sguardo dal ponte, venendo candidata anche ai Drama Desk Award. Dal 2010, a partire da Iron Man 2, ricopre il ruolo di Natasha Romanoff nei film del Marvel Cinematic Univers', , null, 'F');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (23, 'Paul', 'Rudd', '1969-04-06', 'USA', 'Paul Stephen Rudd è un attore, comico, sceneggiatore e produttore americano. Ha studiato teatro all\'Università del Kansas e all\'American Academy of Dramatic Arts prima di debuttare come attore nel 1991.

I film di Rudd includono Clueless (1995), Halloween: The Curse of Michael Myers (1995), Romeo + Juliet (1996), The Object of My Affection (1998), Wet Hot American Summer (2001), Anchorman: The Legend of Ron Burgundy (2004), La quarantenne vergine (2005), Molto incinta (2007), This Is 40 (2012), Wanderlust (2012), Mute (2018), The Fundamentals of Caring (2016), Ideal Home (2018 ) e Ghostbusters: Afterlife (2021). Ha anche interpretato Ant-Man nel Marvel Cinematic Universe, apparendo in Ant-Man (2015), Captain America: Civil War (2016), Ant-Man and the Wasp (2018), Avengers: Endgame (2019), il cartone animato serie E se...? (2021) e Ant-Man and the Wasp: Quantumania (2023).

Oltre alla sua carriera cinematografica, Rudd è apparso in numerosi programmi televisivi, tra cui la sitcom della NBC Friends nei panni di Mike Hannigan, insieme a ruoli da ospite in Tim ed Eric Awesome Show, Great Job!, Reno 911! e Parks and Recreation, e ha anche ospitato il Saturday Night Live più volte. Ha recitato in un doppio ruolo nella serie comica di Netflix Living with Yourself, che gli è valsa una nomination ai Golden Globe come miglior attore - serie televisiva commedia o musicale. Recita nella miniserie The Shrink Next Door (2021).

Ha ricevuto una stella sulla Hollywood Walk of Fame nel luglio 2015. È stato nominato come parte della Forbes Celebrity 100 nel 2019. Nel 2021, Rudd è stato nominato "Sexiest Man Alive" dalla rivista People.', , null, 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (24, 'Benedict', 'Cumberbatch', '1976-07-19', 'Regno Unito', 'Benedict Timothy Carlton Cumberbatch è un attore e doppiatore britannico, noto per aver interpretato Sherlock Holmes nella serie televisiva Sherlock, Khan nel dodicesimo film di Star Trek e il Dottor Strange nel Marvel Cinematic Universe.', , null, 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (26, 'Marta', 'Kauffman', '1956-09-21', 'USA', 'Marta Fran Kauffman (Filadelfia, 21 settembre 1956) è una produttrice televisiva statunitense.

Inizia la sua carriera di attrice presso la Brandeis University, con David Crane, con il quale lavora per più di 20 anni. I due hanno collaborato con il compositore Michael Skloff alla realizzazione di numerosi musical, tra cui una versione teatrale del film Arthur.

Il musical Personals, di cui hanno curato i testi, ha ricevuto un Outer Critics Award e una nomination al Drama Desk. La Kauffman è stata, insieme a Crane e per diversi anni, co-produttrice esecutiva di Dream On, e ha ottenuto un Ace Award e una nomination agli Emmy, per la miglior serie comica.

Inoltre ha contribuito a realizzare la commedia The Powers That Be, in cui recitavano John Forsythe, David Hyde Pierce. Infine han creato le serie, Family Album, L\'atelier di Veronica e Jesse, di cui è stata anche co-produttrice esecutiva.

La sua fama si deve principalmente alla serie Friends, scritta e prodotta in collaborazione con Crane e Kevin Bright, per la durata per 10 stagioni (1994-2004). La serie è ora un classico della TV. L\'ultimo progetto a cui ha preso parte è stato Related. Nel 1984 ha sposato Michael Skloff (poi divorziata nel 2015): i due hanno 3 figli.

Nel 2015 crea per Netflix la serie televisiva Grace and Frankie, con protagoniste Jane Fonda e Lily Tomlin.', , null, 'F');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (27, 'Courteney', 'Cox', '1964-06-15', 'USA', 'Courteney Bass Cox è un\'attrice, regista e produttrice americana. Ha ottenuto il riconoscimento per il suo ruolo da protagonista come Monica Geller nella sitcom della NBC Friends, trasmessa dal 1994 al 2004. Per la sua interpretazione nella serie, ha ricevuto sette nomination allo Screen Actors Guild Award, di cui ne ha vinta una. Ha ricevuto un ulteriore riconoscimento per aver interpretato il ruolo di Gale Weathers nel franchise di film horror Scream (1996-oggi). Ha anche recitato nel ruolo di Lauren Miller nella sitcom della NBC Family Ties (1987-1989), Lucy Spiller nella serie drammatica FX Dirt (2007-2008) e nel ruolo di Jules Cobb nella sitcom della ABC / TBS Cougar Town (2009-2015), l\'ultima delle quali le è valsa la nomination ai Golden Globe e ai Critics\' Choice Awards.

Gli altri film di Cox includono il fantasy d\'azione Masters of the Universe (1987), la commedia Ace Ventura: Pet Detective (1994), la commedia animata Barnyard (2006), la commedia fantasy Bedtime Stories (2008) e il dramma indipendente Mothers and Daughters (2016). Possiede la società di produzione Coquette Productions, creata da Cox e dal suo allora marito David Arquette. Ha anche lavorato come regista nella sua sitcom Cougar Town, nel film drammatico per la televisione TalhotBlond (2012) e nel film drammatico commedia nera Just Before I Go (2014).', , null, 'F');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (28, 'Lisa', 'Kudrow', '1963-07-30', 'USA', 'Lisa Valerie Kudrow (nata il 30 luglio 1963) è un\'attrice, comica, scrittrice e produttrice americana. Dopo aver fatto apparizioni in diverse sitcom televisive degli anni \'80, Kudrow è diventata famosa a livello internazionale negli anni \'90 per aver interpretato Phoebe Buffay nella sitcom americana Friends, che le è valsa i premi Primetime Emmy e Screen Actors Guild. Kudrow ha anche interpretato la sorella gemella di Phoebe, Ursula, sia in Friends che in Mad About You. Kudrow ha ricevuto numerosi premi, tra cui un Primetime Emmy Award come miglior attrice non protagonista in una serie comica su sei nomination, due Screen Actors Guild Awards su 12 nomination e una nomination al Golden Globe Award. Il personaggio di Her Friends era molto popolare mentre la serie andava in onda e in seguito è stata riconosciuta come uno dei più grandi personaggi femminili della televisione americana.

Kudrow ha recitato nella commedia cult Romy and Michele\'s High School Reunion (1997), seguita da un\'acclamata interpretazione nella commedia romantica The Opposite of Sex (1998), che le è valsa il New York Film Critics Circle Award come migliore attrice non protagonista e una nomination per l\'Independent Spirit Award per la migliore donna non protagonista. Nel 2005, ha continuato a produrre, scrivere e recitare nella serie comica della HBO The Comeback, che è stata riproposta nove anni dopo per una seconda stagione. Kudrow è stata nominata per il Primetime Emmy Award come miglior attrice protagonista in una serie comica per entrambe le stagioni.

Nel 2007, Kudrow ha ricevuto elogi per il suo ruolo da protagonista nel film Kabluey ed è apparsa nel film di successo al botteghino PS I Love You. Ha prodotto e recitato nel programma Showtime Web Therapy (2011-2015), che è stato nominato per un Primetime Emmy Award. È produttrice del programma di realtà TLC Who Do You Think You Are, che le è valso cinque nomination ai Primetime Emmy Award.

Kudrow ha anche fatto diverse apparizioni cinematografiche degne di nota, inclusi ruoli in Analyze This (1999), Dr. Dolittle 2 (2001), Bandslam (2008), Hotel for Dogs (2009), Easy A (2010), Neighbours (2014) e il suo sequel Neighbors 2: Sorority Rising (2016), The Girl on the Train (2016), The Boss Baby (2017), Long Shot (2019) e Booksmart (2019).', , null, 'F');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (29, 'Matt', 'LeBlanc', '1965-07-25', 'USA', 'Matthew Steven LeBlanc (nato il 25 luglio 1967) è un attore americano. Ha ottenuto il riconoscimento globale con la sua interpretazione di Joey Tribbiani nella sitcom della NBC Friends e nella sua serie spin-off, Joey. Per il suo lavoro in Friends, LeBlanc ha ricevuto tre nomination ai Primetime Emmy Awards. Ha anche interpretato una versione romanzata di se stesso in Episodes (2011-2017), per il quale ha vinto un Golden Globe e ha ricevuto altre quattro nomination agli Emmy Award. Ha co-ospitato Top Gear dal 2016 al 2019. Dal 2016 al 2020, ha interpretato il patriarca Adam Burns nella sitcom della CBS Man with a Plan.', , null, 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (30, 'Matthew', 'Perry', '1969-08-19', 'USA', 'Matthew Langford Perry (nato il 19 agosto 1969) è un attore americano-canadese, meglio conosciuto per il suo ruolo di Chandler Bing nella popolare sitcom televisiva della NBC Friends, per la quale ha ottenuto una nomination all\'Emmy Award nel 2002. di Ron Clark in The Ron Clark Story gli è valso una candidatura agli Emmy e ai Golden Globe. Ha anche recitato in tre episodi della serie drammatica The West Wing, che gli è valsa due nomination consecutive agli Emmy nel 2003 e nel 2004. Perry ha anche recitato nella serie di breve durata Studio 60 sulla Sunset Strip, e ha avuto ruoli nei film The Whole Nine Yards (2000) e il suo sequel The Whole Ten Yards (2004), Numb (2007) e 17 Again (2009).

Perry è il co-creatore, co-sceneggiatore, produttore esecutivo e protagonista della sitcom della ABC Mr. Sunshine, presentata in anteprima il 9 febbraio 2011.', , null, 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (31, 'David', 'Schwimmer', '1966-11-02', 'USA', 'David Lawrence Schwimmer (nato il 2 novembre 1966) è un attore e regista americano di televisione e cinema. È nato a New York e la sua famiglia si è trasferita a Los Angeles quando aveva due anni. Ha iniziato la sua carriera di attore esibendosi in recite scolastiche alla Beverly Hills High School. Nel 1988 si è laureato alla Northwestern University con un Bachelor of Arts in teatro e discorso. Dopo la laurea, Schwimmer ha co-fondato la Lookingglass Theatre Company. Per gran parte della fine degli anni \'80, ha vissuto a Los Angeles come attore disoccupato in difficoltà.

È apparso nel film televisivo A Deadly Silence nel 1989. È poi apparso in numerosi ruoli televisivi, tra cui LA Law, The Wonder Years, NYPD Blue e Monty nei primi anni \'90. Schwimmer ha successivamente ottenuto riconoscimenti a livello mondiale per aver interpretato Ross Geller nella commedia di situazioni Friends. Oltre ad apparire in televisione, ha recitato nel suo primo ruolo da protagonista in The Pallbearer (1996), seguito da ruoli in Kissing a Fool (1998), Six Days Seven Nights (1998), Apt Pupil e Picking Up the Pieces ( 2000). È stato poi scritturato nella miniserie Band of Brothers (2001) come Herbert Sobel.

Dopo il finale della serie di Friends nel 2004, Schwimmer è stato scelto come protagonista nel film drammatico del 2005 Duane Hopwood. Altri ruoli cinematografici includono il film d\'animazione al computer Madagascar (2005), la commedia dark Big Nothing (2006), il thriller Nothing But the Truth (2008) e Madagascar: Escape 2 Africa (2008). Schwimmer ha esordito sul palcoscenico londinese nel 2005 come protagonista in Some Girl(s). Nel 2006 ha debuttato a Broadway in The Caine Mutiny Court-Martial. Schwimmer ha debuttato alla regia di un lungometraggio con la commedia del 2007 Run Fatboy Run. L\'anno successivo ha fatto il suo debutto alla regia off-Broadway nella produzione del 2008 Fault Lines.', , null, 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (32, 'Jonathan', 'Bailey', '1988-04-25', 'Regno Unito', 'Jonathan Stuart Bailey (nato il 25 aprile 1988) è un attore inglese. Conosciuto per i suoi ruoli comici, drammatici e musicali sul palcoscenico e sullo schermo, ha ricevuto un Laurence Olivier Award e nomination per l\'Evening Standard Theatre e lo Screen Actor Guild Awards. Ha vinto il Laurence Olivier Award come miglior attore non protagonista in un musical nel 2019.

Sullo schermo, Bailey ha recitato nella serie d\'azione e avventura della CBBC Leonardo (2011–12) e nella commedia musicale di Disney Channel Groove High (2012–13) prima di diventare famoso per i suoi ruoli nel film poliziesco di ITV Broadchurch (2013–15), nella satira della BBC W1A (2014-17) e la commedia di Channel 4 Crashing (2016). Ha ottenuto il riconoscimento internazionale per la sua interpretazione acclamata dalla critica di Anthony, visconte Bridgerton nel dramma romantico Netflix Regency Bridgerton.', , null, 'M');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (33, 'Phoebe', 'Dynevor', '1995-04-17', 'Regno Unito', 'Phoebe Harriet Dynevor (nata il 17 aprile 1995) è un\'attrice inglese. Dynevor è meglio conosciuta per il suo ruolo di Daphne, la quarta figlia di Bridgerton, nel dramma in costume di Netflix Bridgerton (2020-2022).

Ha iniziato la sua carriera come attrice bambina nel dramma scolastico della BBC One Waterloo Road (2009-2010). Ha continuato ad avere ruoli ricorrenti nelle serie della BBC Prisoners \'Wives (2012-2013) e Dickensian (2015-2016), e nella commedia drammatica di TV Land Younger (2017-2021), oltre a un ruolo nel crimine Crackle serie Snatch (2017-2018).', , null, 'F');
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, biografia, foto, data_morte, sesso) VALUES (34, 'Julia', 'Quinn', '1970-01-01', 'USA', 'Julia Pottinger (1970), pseudonimo di Julie Cotler, è la scrittrice americana che si cela anche dietro lo pseudonimo di Julia Quinn e la famosa saga di Bridgerton.

Nata in una famiglia ebrea, è cresciuta a New York e in California. Si laura in Storia dell\'Arte ad Harvard, ma durante l\'ultimo anno ebbe dei dubbi su questa laurea e decise di prepararsi a studiare Medicina. In procinto di entrare in medicina, il suo agente gli disse che i suoi primi due romanzi, Splendid e Dancing at Midnight, erano in una guerra di offerte tra due editori.

Questo fatto ha fatto rimandare a Julia la sua idea iniziale di studiare medicina per un paio d\'anni e quindi scrivere altri due libri. Ma dopo due anni ha avuto un momento di introspezione e ha pensato che forse era meglio studiare medicina ed è entrata a Yale. E dopo un paio di mesi al college, ha finalmente capito che la sua vera vocazione era scrivere e ha abbandonato definitivamente l\'idea di diventare medico.

È una femminista convinta, come rispecchiano alcuni suoi personaggi.

La sua bibliografia comprende le saghe/serie: Splendid Trilogy, Lyndon Sisters, Crown Agents, The Bridgertons, Bevelstoke Series, Smythe-Smith Quartet, Rokesby Series e Lady Whistledown.

Ma senza dubbio la sua serie più famosa è The Bridgertons, che si compone di 8 romanzi, ognuno incentrato su un personaggio, tra i quali: Il duca ed io, Il visconte che mi amava, Ti do il mio cuore, Sedurre il signor Bridgerton. Julia ha ricevuto numerosi RITA Awards per questa serie.

The Bridgertons è stato adattato nel 2021 come serie televisiva per Netflix dalla prestigiosa produttrice e sceneggiatrice Shonda Rhimes, catapultando i libri nelle prime posizioni di vendita.

A livello personale è sposata con Paul Pottinger, al quale dedica i suoi libri, ed è madre di due figli.', , null, 'F');
